        )[0].dobDay
    };



    render() {
        return (
            <div>
                {
                    this.props.users.filter(
                        user => {
                            return user.active    
                        }
                    )[0].firstName
                }

                <h3 style={{color: "white"}}>Test Message</h3>
            </div>
        )
    }
}



